                    165/285 อาคารสารินเพลส ชั้น 5 (ตรงข้ามธนาคารไทยพาณิชย์สำนักงานใหญ่) ซอยรัชดาภิเษก 46 ถนนรัชดาภิเษก แขวงลาดยาว เขตจตุจักร กรุงเทพมหานคร 10900
<br></br>โทร. 02-930-3418   |   แฟกซ์. 02-939-6906   |   อีเมล์. info@qpm.co.th </p>
                <p align="center"><img src="./images/maps.png" /> </p>
            </div>
        )
    }
}
